import{_ as l,c as i,o as e,a}from"./app.7b36c640.js";const f='{"title":"\uB4E4\uC5B4\uAC00\uBA74\uC11C","description":"","frontmatter":{},"headers":[{"level":2,"title":"\uBAA9\uCC28","slug":"\uBAA9\uCC28"},{"level":2,"title":"\uCF54\uB4DC\uAC00 \uC874\uC7AC\uD558\uB9AC\uB77C","slug":"\uCF54\uB4DC\uAC00-\uC874\uC7AC\uD558\uB9AC\uB77C"},{"level":2,"title":"\uB098\uC05C \uCF54\uB4DC","slug":"\uB098\uC05C-\uCF54\uB4DC"},{"level":2,"title":"\uAE54\uB054\uD55C \uCF54\uB4DC\uC5D0 \uB300\uD55C \uC815\uC758","slug":"\uAE54\uB054\uD55C-\uCF54\uB4DC\uC5D0-\uB300\uD55C-\uC815\uC758"},{"level":3,"title":"\uD074\uB9B0 \uCF54\uB4DC\uC5D0 \uB300\uD55C \uC758\uACAC","slug":"\uD074\uB9B0-\uCF54\uB4DC\uC5D0-\uB300\uD55C-\uC758\uACAC"},{"level":2,"title":"\uC6B0\uB9AC\uB4E4\uC758 \uC0DD\uAC01\uACFC \uC815\uB9AC","slug":"\uC6B0\uB9AC\uB4E4\uC758-\uC0DD\uAC01\uACFC-\uC815\uB9AC"}],"relativePath":"CLEAN_CODE/Chapter_1.md"}',r={},t=a('<h1 id="\uB4E4\uC5B4\uAC00\uBA74\uC11C" tabindex="-1">\uB4E4\uC5B4\uAC00\uBA74\uC11C <a class="header-anchor" href="#\uB4E4\uC5B4\uAC00\uBA74\uC11C" aria-hidden="true">#</a></h1><ul><li>\uCF54\uB4DC\uC758 \uD488\uC9C8\uC744 \uB192\uC774\uACE0 \uD6CC\uB96D\uD55C \uCF54\uB4DC\uB97C \uC704\uD55C \uD574\uB2F5\uC740 <code>\uC7A5\uC778 \uC815\uC2E0</code>\uC774\uB2E4</li><li>\uC6D0\uCE59\uACFC \uD328\uD134\uC744 \uBC30\uC6B0\uACE0, \uBAB8\uC73C\uB85C \uC9C1\uC811 \uC775\uD788\uBA74\uC11C \uBC30\uC6CC\uC57C\uD55C\uB2E4</li><li>\uC774 \uCC45\uC740 \uC138 \uAC00\uC9C0 \uBD80\uBD84\uC73C\uB85C \uB098\uB220\uC9C4\uB2E4 <ol><li>\uAE68\uB057\uD55C \uCF54\uB4DC\uB97C \uC791\uC131\uD558\uB294 \uC6D0\uCE59, \uD328\uD134\uC744 \uCF54\uB4DC\uB85C \uC124\uBA85</li><li>\uC870\uAE08 \uB354 \uBCF5\uC7A1\uD55C \uC5EC\uB7EC \uC0AC\uB840\uB4E4\uC744 \uC81C\uC2DC\uD558\uBA70 \uC774\uB97C \uB354 \uAE54\uB054\uD558\uACE0 \uD6A8\uC728\uC801\uC73C\uB85C \uBC14\uAFB8\uB294 \uC5F0\uC2B5</li><li>\uC55E\uC758 \uC0AC\uB840\uB4E4\uC744 \uD1B5\uD574 \uC5BB\uC740 \uC774\uC720\uC640 \uD734\uB9AC\uC2A4\uD2F1\uC744 \uC815\uB9AC\uD558\uB294 \uACB0\uB9D0</li></ol></li><li>\uCC45\uC744 \uD1B5\uD574 \uCF54\uB4DC\uB97C \uC218\uC815\uD558\uAC8C \uB41C \uC774\uC720\uC640 \uD734\uB9AC\uC2A4\uD2F1 \uC0AC\uC774\uC758 \uAD00\uACC4\uB97C \uC774\uD574\uD558\uB294 \uAC83\uC774 \uC911\uC694\uD558\uB2E4.</li><li>\uB300\uCDA9 \uBCFC \uC218 \uC788\uB294 \uCC45\uC774 \uC544\uB2C8\uB77C \uC5F4\uC2EC\uD788 \uC9D1\uC911\uD574\uC11C \uBD10\uC57C\uD558\uB294 \uCC45\uC774\uB77C\uB294 \uAC83\uC744 \uAC15\uC870\uD558\uB294 \uCC55\uD130!!</li></ul><h1 id="chapter-1-\uAE68\uB057\uD55C-\uCF54\uB4DC" tabindex="-1">Chapter 1 - \uAE68\uB057\uD55C \uCF54\uB4DC <a class="header-anchor" href="#chapter-1-\uAE68\uB057\uD55C-\uCF54\uB4DC" aria-hidden="true">#</a></h1><h2 id="\uBAA9\uCC28" tabindex="-1">\uBAA9\uCC28 <a class="header-anchor" href="#\uBAA9\uCC28" aria-hidden="true">#</a></h2><hr><ul><li>\uCF54\uB4DC\uAC00 \uC874\uC7AC\uD558\uB9AC\uB77C</li><li>\uB098\uC05C \uCF54\uB4DC</li><li>\uAE54\uB054\uD55C \uCF54\uB4DC\uC5D0 \uB300\uD55C \uC815\uC758</li><li>\uC6B0\uB9AC\uB4E4 \uC0DD\uAC01\uACFC \uC815\uB9AC</li></ul><hr><p>\uC774 \uCC45\uC740 \uCF54\uB4DC \uD22C\uC131\uC774\uC758 \uCC45\uC774\uB2E4. \uC774 \uCC45\uC744 \uC77D\uACE0 \uB098\uBA74 \uCF54\uB4DC\uC5D0 \uB300\uD574 \uB9CE\uC740 \uC0AC\uC2E4\uC744 \uBC30\uC6B8 \uC218 \uC788\uC744 \uAC83\uC774\uB2E4. \uADF8\uB9AC\uACE0 \uC88B\uC740 \uCF54\uB4DC\uC640 \uB098\uC05C \uCF54\uB4DC\uB97C \uAD6C\uBD84\uD558\uB294 \uB2A5\uB825\uB3C4 \uC0DD\uAE30\uACE0, \uC88B\uC740 \uCF54\uB4DC\uB97C \uC791\uC131\uD558\uB294 \uBC29\uBC95\uB3C4 \uC775\uD78C\uB2E4. \uB9C8\uC9C0\uB9C9\uC73C\uB85C \uB098\uC05C \uCF54\uB4DC\uB97C \uC88B\uC740 \uCF54\uB4DC\uB85C \uBC14\uAFB8\uB294 \uC2E4\uB825\uB3C4 \uC313\uC778\uB2E4.</p><h2 id="\uCF54\uB4DC\uAC00-\uC874\uC7AC\uD558\uB9AC\uB77C" tabindex="-1">\uCF54\uB4DC\uAC00 \uC874\uC7AC\uD558\uB9AC\uB77C <a class="header-anchor" href="#\uCF54\uB4DC\uAC00-\uC874\uC7AC\uD558\uB9AC\uB77C" aria-hidden="true">#</a></h2><hr><ul><li>\uCF54\uB4DC \uC5C6\uC774\uB294 \uC694\uAD6C\uC0AC\uD56D\uC744 \uCD94\uC0C1\uD654\uD560\uC218\uB3C4, \uC0C1\uC138\uD788 \uC124\uBA85\uD560 \uC218\uB3C4 \uC5C6\uB2E4</li><li>\uC694\uAD6C\uC0AC\uD56D\uB4E4\uC744 \uAE30\uACC4\uAC00 \uC774\uD574\uD560 \uC218 \uC788\uC744 \uC815\uB3C4\uB85C \uC0C1\uC138\uD558\uAC8C \uC694\uAD6C\uC0AC\uD56D\uC744 \uC815\uD615\uD654\uC2DC\uCF1C \uBA85\uC2DC\uD55C \uAC83\uC774 \uCF54\uB4DC</li><li>\uCF54\uB4DC\uB294 \uC694\uAD6C\uC0AC\uD56D\uC744 \uD45C\uD604\uD558\uB294 \uC5B8\uC5B4\uB2E4</li></ul><h2 id="\uB098\uC05C-\uCF54\uB4DC" tabindex="-1">\uB098\uC05C \uCF54\uB4DC <a class="header-anchor" href="#\uB098\uC05C-\uCF54\uB4DC" aria-hidden="true">#</a></h2><hr><ul><li>\uB098\uC05C \uCF54\uB4DC\uB294 \uD68C\uC0AC\uB3C4 \uB9DD\uD558\uAC8C \uD560 \uC218 \uC788\uB2E4</li><li>\uC11C\uB450\uB974\uACE0 \uAE09\uD558\uAC8C \uC9DC\uACE0, \uB098\uC911\uC5D0 \uB2E4\uC2DC \uACE0\uCCD0\uBCF4\uC790\uB77C\uACE0 \uC0DD\uAC01\uD588\uB358 \uCF54\uB4DC\uB4E4\uC740 \uC2A4\uB178\uC6B0\uBCFC\uB85C \uAD74\uB7EC \uB2E4\uC2DC\uB294 \uC190\uB300\uAE30 \uC2EB\uC740 \uB098\uC05C\uCF54\uB4DC\uAC00 \uB41C\uB2E4 <ul><li>\uADF8\uB9AC\uACE0 \uADF8 \uB098\uC911\uC740 \uC808\uB300 \uC624\uC9C0 \uC54A\uB294\uB2E4</li></ul></li><li>\uB098\uC05C \uCF54\uB4DC\uB4E4\uC740 \uCF54\uB4DC\uB97C \uAC74\uB4E4\uC77C\uB54C\uB9C8\uB2E4 \uCF54\uB4DC \uD574\uB3C5\uC5D0 \uB354 \uB9CE\uC740 \uC2DC\uAC04\uC744 \uC4F0\uAC8C \uB9CC\uB4E4\uACE0 \uC0DD\uC0B0\uC131\uC774 \uC800\uD558\uB41C\uB2E4 <ul><li>\uACB0\uAD6D\uC740 \uC0DD\uC0B0\uC131\uC774 0\uC5D0 \uC218\uB834\uD558\uAC8C \uB41C\uB2E4</li></ul></li><li>\uD68C\uC0AC\uC5D0\uC11C \uC0DD\uC0B0\uC131\uC744 \uB192\uC774\uB77C\uB294 \uC555\uBC15\uC5D0 \uB098\uC05C \uCF54\uB4DC\uB97C \uC791\uC131\uD558\uAC8C \uB41C\uB2E4\uB294 \uD551\uACC4\uB97C \uB300\uC9C0 \uB9D0\uC544\uB77C <ul><li>\uC55E\uC11C \uB9D0\uD55C \uC7A5\uC778\uC815\uC2E0\uC744 \uAC00\uC838\uC57C \uD558\uACE0, \uC804\uBB38\uAC00\uB2F5\uAC8C \uB098\uC05C \uCF54\uB4DC\uC758 \uD574\uC545\uC131\uACFC \uC704\uD5D8\uC744 \uC5B4\uD544\uD574\uC57C \uD55C\uB2E4</li></ul></li><li>\uCD5C\uB300\uD55C \uAE54\uB054\uD55C \uCF54\uB4DC\uB97C \uD56D\uC0C1 \uC720\uC9C0\uD558\uB294 \uAC83\uC774 \uAC00\uC7A5 \uC911\uC694\uD558\uB2E4</li></ul><h2 id="\uAE54\uB054\uD55C-\uCF54\uB4DC\uC5D0-\uB300\uD55C-\uC815\uC758" tabindex="-1">\uAE54\uB054\uD55C \uCF54\uB4DC\uC5D0 \uB300\uD55C \uC815\uC758 <a class="header-anchor" href="#\uAE54\uB054\uD55C-\uCF54\uB4DC\uC5D0-\uB300\uD55C-\uC815\uC758" aria-hidden="true">#</a></h2><hr><ul><li>\uD074\uB9B0 \uCF54\uB4DC\uB294 \uBA4B\uC9C4 \uADF8\uB9BC\uC744 \uADF8\uB9AC\uB294 \uAC83\uACFC \uAC19\uB2E4</li><li>\uD074\uB9B0 \uCF54\uB4DC\uB97C \uC704\uD574 \uACBD\uD5D8\uC744 \uC313\uC73C\uBA70 \uCF54\uB4DC \uAC10\uAC01\uC744 \uD0A4\uC6CC\uC57C \uD55C\uB2E4</li></ul><h3 id="\uD074\uB9B0-\uCF54\uB4DC\uC5D0-\uB300\uD55C-\uC758\uACAC" tabindex="-1">\uD074\uB9B0 \uCF54\uB4DC\uC5D0 \uB300\uD55C \uC758\uACAC <a class="header-anchor" href="#\uD074\uB9B0-\uCF54\uB4DC\uC5D0-\uB300\uD55C-\uC758\uACAC" aria-hidden="true">#</a></h3><hr><ul><li>\uBE44\uC57C\uB124 \uC2A4\uD2B8\uB86D\uC2A4\uD2B8\uB8F9 (C++ \uCC3D\uC2DC\uC790) <ul><li>\uCF54\uB4DC\uB294 \uC990\uAC81\uAC8C \uC77D\uD600\uC57C\uD558\uBA70, \uD6A8\uC728\uC801\uC778 \uCF54\uB4DC\uC5EC\uC57C \uD55C\uB2E4</li><li>\uC5D0\uB7EC \uD578\uB4E4\uB9C1, \uBA54\uBAA8\uB9AC \uB204\uC218, \uACBD\uC7C1\uC0C1\uD0DC, \uB124\uC774\uBC0D \uB4F1 \uB514\uD14C\uC77C\uC5D0 \uC2E0\uACBD\uC744 \uC368\uC57C\uD55C\uB2E4</li><li>\uB108\uBB34 \uB9CE\uC740 \uC77C\uC744 \uD558\uB824\uB2E4 \uBAA9\uC801\uC774 \uD750\uB824\uC9C0\uB294 \uCF54\uB4DC\uBCF4\uB2E4 \uD55C\uAC00\uC9C0 \uAE38\uB9CC \uAC00\uB294 \uCF54\uB4DC\uAC00 \uD074\uB9B0 \uCF54\uB4DC\uC774\uB2E4</li><li>\uD074\uB9B0 \uCF54\uB4DC\uB294 <code>\uD55C\uAC00\uC9C0\uB97C \uC798 \uD558\uB294 \uCF54\uB4DC</code>\uB97C \uB73B\uD55C\uB2E4</li></ul></li><li>\uADF8\uB798\uB514 \uBD80\uCE58 (Object Oriented Analysis and Design with Applications \uC800\uC790) <ul><li>\uD074\uB9B0 \uCF54\uB4DC\uB294 \uC18C\uC124\uCC98\uB7FC \uAE30\uC2B9\uC804\uACB0\uC744 \uAC00\uC9C0\uBA70 \uC220\uC220 \uC77D\uD600\uC57C \uD55C\uB2E4</li><li>\uCF54\uB4DC\uB294 \uCD94\uCE21\uC774 \uC544\uB2CC \uC0AC\uC2E4\uC5D0 \uAE30\uBC18\uD574\uC57C \uD55C\uB2E4</li></ul></li><li>BIG \uB370\uC774\uBE0C \uD1A0\uB9C8\uC2A4 (OTI \uCC3D\uB9BD\uC790, \uC774\uD074\uB9BD\uC2A4 \uC804\uB7B5\uC758 \uB300\uBD80) <ul><li>\uD074\uB9B0 \uCF54\uB4DC\uB780 \uB2E4\uB978 \uC0AC\uB78C\uC774 \uACE0\uCE58\uAE30 \uC26C\uC6CC\uC57C \uD55C\uB2E4</li><li>\uD14C\uC2A4\uD2B8 \uCF00\uC774\uC2A4\uAC00 \uC5C6\uB294 \uCF54\uB4DC\uB294 \uD074\uB9B0 \uCF54\uB4DC\uAC00 \uC544\uB2C8\uB2E4</li></ul></li><li>\uB9C8\uC774\uD074 \uD398\uB354\uC2A4 (Working Effectively with Legacy Code \uC800\uC790) <ul><li>\uD074\uB9B0 \uCF54\uB4DC\uB294 \uC8FC\uC758\uAE4A\uAC8C \uC791\uC131\uD55C \uCF54\uB4DC\uB2E4</li><li>\uACE0\uCE58\uB824\uACE0 \uC0B4\uD3B4\uBD10\uB3C4 \uC190 \uB308 \uACF3\uC774 \uC5C6\uC73C\uBA70, \uAD81\uB9AC\uB97C \uD558\uB2E4\uBCF4\uBA74 \uC81C\uC790\uB9AC\uB85C \uB3CC\uC544\uC624\uB294 \uCF54\uB4DC</li><li>\uAE54\uB054\uD558\uACE0 \uB2E8\uC815\uD558\uAC8C \uC815\uB9AC\uD55C \uCF54\uB4DC</li></ul></li><li>\uB860 \uC81C\uD504\uB9AC\uC2A4 (Extreme Programming Installed\uC640 Extreme Programming Adventure in C# \uC800\uC790) <ul><li>\uC911\uBCF5\uC744 \uD53C\uD574\uB77C</li><li>\uD55C \uAE30\uB2A5\uB9CC \uC218\uD589\uD558\uB77C</li><li>\uC81C\uB300\uB85C \uD45C\uD604\uD558\uB77C</li><li>\uC791\uAC8C \uCD94\uC0C1\uD654\uD558\uB77C</li></ul></li><li>\uC704\uB4DC \uCEE4\uB2DD\uD584 (\uC704\uD0A4 \uCC3D\uC2DC\uC790, \uD53C\uD2B8 \uCC3D\uC2DC\uC790, \uC775\uC2A4\uD2B8\uB9BC \uD504\uB85C\uADF8\uB798\uBC0D \uACF5\uB3D9 \uCC3D\uC2DC\uC790 \uB4F1\uB4F1\uB4F1) <ul><li>\uCF54\uB4DC\uB97C \uC77D\uC73C\uBA74\uC11C \uC9D0\uC791\uD588\uB358 \uAE30\uB2A5\uC744 \uAC01 \uB8E8\uD2F4\uC774 \uADF8\uB300\uB85C \uC218\uD589\uD55C\uB2E4\uBA74 \uAE68\uB057\uD55C \uCF54\uB4DC\uC774\uB2E4</li><li>\uAE68\uB057\uD55C \uCF54\uB4DC\uB294 \uC77D\uC73C\uBA74\uC11C \uB180\uB784 \uC77C\uC774 \uC5C6\uC5B4\uC57C \uD55C\uB2E4</li><li>\uC5B8\uC5B4\uB97C \uD0D3\uD558\uC9C0 \uB9D0\uACE0 \uCF54\uB4DC\uB97C \uB2E8\uC21C\uD558\uAC8C \uBCF4\uC774\uB3C4\uB85D \uB9CC\uB4DC\uB294 \uCC45\uC784\uC740 \uAC1C\uBC1C\uC790\uC5D0\uAC8C \uC788\uB2E4</li></ul></li></ul><h2 id="\uC6B0\uB9AC\uB4E4\uC758-\uC0DD\uAC01\uACFC-\uC815\uB9AC" tabindex="-1">\uC6B0\uB9AC\uB4E4\uC758 \uC0DD\uAC01\uACFC \uC815\uB9AC <a class="header-anchor" href="#\uC6B0\uB9AC\uB4E4\uC758-\uC0DD\uAC01\uACFC-\uC815\uB9AC" aria-hidden="true">#</a></h2><hr><ul><li>\uC774 \uB0B4\uC6A9\uB4E4\uC744 \uD55C \uBB38\uC7A5\uC73C\uB85C \uC815\uB9AC\uD558\uBA70 \uC774 \uCC45\uC758 \uC8FC\uC81C\uB97C \uB9D0\uD574\uBCF4\uC790\uBA74 <code>\uCF54\uB4DC\uB97C \uC8FC\uC758 \uAE4A\uAC8C \uC9DC\uB294 \uBC29\uBC95</code>\uC774\uB77C \uD560 \uC218 \uC788\uB2E4</li><li>\uBB3C\uB860 \uC774 \uCC45\uC5D0\uC11C \uB9D0\uD558\uB294 \uBC29\uC2DD\uB4E4\uC740 \uBC31\uD504\uB85C \uC633\uC740 \uC815\uB2F5\uC774\uB77C\uAE30 \uBCF4\uB2E4 \uC218\uC2ED\uB144\uC758 \uC2DC\uD589\uCC29\uC624\uB85C \uC644\uC131\uB41C \uC624\uB2F5\uB178\uD2B8\uC774\uB2E4</li><li>\uCF54\uB529\uC744 \uD558\uB2E4\uBCF4\uBA74 \uC774\uC804\uC5D0 \uC791\uC131\uB41C \uCF54\uB4DC\uB97C \uACC4\uC18D\uD574\uC11C \uC77D\uACE0, \uC0C8\uB85C \uCF54\uB4DC\uB97C \uC870\uAE08 \uC791\uC131\uD558\uACE0 \uB2E4\uC2DC \uB610 \uACE0\uCE58\uB294 \uC77C\uC758 \uBC18\uBCF5\uC774\uB2E4</li><li>\uC0DD\uAC01\uBCF4\uB2E4 \uC791\uC131\uB41C \uCF54\uB4DC\uB97C \uB4E4\uC5EC\uB2E4\uBCFC \uC77C\uC774 \uB9CE\uACE0, \uC774\uAC83\uC774 \uAE54\uB054\uD55C \uCF54\uB4DC\uC758 \uC911\uC694\uC131\uC774\uB2E4</li></ul>',23),h=[t];function d(u,n,c,s,o,_){return e(),i("div",null,h)}var g=l(r,[["render",d]]);export{f as __pageData,g as default};
